import { Button, VStack } from '@chakra-ui/react';

const SidebarContent = ({ onClick }) => (
	<VStack>
		<Button onClick={onClick} w="100%">
			Deniz Kaptan
		</Button>
		<Button onClick={onClick} w="100%">
			About
		</Button>
		<Button onClick={onClick} w="100%">
			Contact
		</Button>
	</VStack>
);

export default SidebarContent;
